let defaultState={
    history:{
        "token":"",
        "status":"",
        "data":{},
        "message":"",
        "errorCode":""
    }
}

const mainReducer=(state=defaultState,action)=>{

    switch(action.type)
    {
        case "CHANGE_HISTORY":
                            return{
                                ...state,
                                history:[action.history]
                            }                            
        default:
                            return{
                                ...state
                            }
    }
}

export default mainReducer;
